import React, { Component } from "react";
import "../style/typing.css";
import Typist from 'react-typist';


class Landing extends Component {
  render() {
    const style = { textAlign: "center", fontSize: '5em', marginTop: '50px' };
    return (
      <div className="landing">
        <div style={style}>Welcom to Musicly</div>
        <Typist className="typist">
        <Typist.Delay ms={2500} />
          {/* Hello my friend.<Typist.Delay ms={1000} /><br/>
          This site is going to help you improve your musical hearing.<Typist.Delay ms={1000} /><br/> */}
          Sign up for free and become the next Mozart<Typist.Backspace count={6} delay={1000} />Bach<Typist.Backspace count={4} delay={700} />Chopin<Typist.Backspace count={22} delay={700} />lets just begin!

        </Typist>
      </div>
    );
  }
}

export default Landing;
